import react from 'react';
import Favourite from './Favourite';








class FavouriteOneTrack extends React.Component {
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div>

                <div>ITS YOUR FAVOURITE SONGS</div>

                <select onChange={this.props.changeLimit.bind(this)} >
                    <option>5</option>
                    <option>10</option>
                    <option>15</option>
                    <option>20</option>
                    <option>25</option>
                    <option>30</option>
                </select> 

            </div>

        )
    }   
}

export default FavouriteOneTrack;
